pragma solidity 0.7.3;

contract REA_Pre {

	enum Economic_Agent_Type { None, agent_type_identified }
	enum Economic_Agent { None, participating }
	enum Economic_Resource_Type { None, resource_type_identified }
	enum Economic_Resource { None, available, unavailable }
	enum Business_Process_Overview { None, planning, identification, negotiation, actualization, post_actualization }
	enum Business_Process_Detail { None, catalogue_requested, catalogue_received, identification, negotiation, offer_consideration, counter_consideration, remittance, despatch, receipt, invoice, abandoned, completed }
	enum Economic_Contract { None, offered, accepted, in_service, contract_complete }
	enum Economic_Commitment { None, proposed, in_service_commitment, commitment_complete }
	enum Economic_Event { None, specified, in_service_event, pending_event, event_complete }
	enum Business_Process_Phase { None, phase_waiting, in_service_phase, phase_complete }

	Economic_Agent_Type public Economic_Agent_Type_state;
	Economic_Agent public Economic_Agent_state;
	Economic_Resource_Type public Economic_Resource_Type_state;
	Economic_Resource public Economic_Resource_state;
	Business_Process_Overview public Business_Process_Overview_state;
	Business_Process_Detail public Business_Process_Detail_state;
	Economic_Contract public Economic_Contract_state;
	Economic_Commitment public Economic_Commitment_state;
	Economic_Event public Economic_Event_state;
	Business_Process_Phase public Business_Process_Phase_state;


	function identify_agent_type() public {
		bool _Economic_Agent_Type_state = Economic_Agent_Type_state == Economic_Agent_Type.None;
		require(_Economic_Agent_Type_state, "Economic Agent Type not satisfied, cannot run identify_agent_type");

		Economic_Agent_Type_state = Economic_Agent_Type.agent_type_identified;
	}

	function modify() public {
		bool _Economic_Agent_Type_state = Economic_Agent_Type_state == Economic_Agent_Type.agent_type_identified;
		require(_Economic_Agent_Type_state, "Economic Agent Type not satisfied, cannot run modify");

		bool _Economic_Agent_state = Economic_Agent_state == Economic_Agent.participating;
		require(_Economic_Agent_state, "Economic Agent not satisfied, cannot run modify");

		bool _Economic_Resource_Type_state = Economic_Resource_Type_state == Economic_Resource_Type.resource_type_identified;
		require(_Economic_Resource_Type_state, "Economic Resource Type not satisfied, cannot run modify");

		Economic_Agent_Type_state = Economic_Agent_Type.agent_type_identified;
		Economic_Agent_state = Economic_Agent.participating;
		Economic_Resource_Type_state = Economic_Resource_Type.resource_type_identified;
	}

	function identify_agent() public {
		bool _Economic_Agent_state = Economic_Agent_state == Economic_Agent.None;
		require(_Economic_Agent_state, "Economic Agent not satisfied, cannot run identify_agent");

		Economic_Agent_state = Economic_Agent.participating;
	}

	function identify_resource_type() public {
		bool _Economic_Resource_Type_state = Economic_Resource_Type_state == Economic_Resource_Type.None;
		require(_Economic_Resource_Type_state, "Economic Resource Type not satisfied, cannot run identify_resource_type");

		Economic_Resource_Type_state = Economic_Resource_Type.resource_type_identified;
	}

	function identify_available_resource() public {
		bool _Economic_Resource_state = Economic_Resource_state == Economic_Resource.None;
		require(_Economic_Resource_state, "Economic Resource not satisfied, cannot run identify_available_resource");

		Economic_Resource_state = Economic_Resource.available;
	}

	function sold() public {
		bool _Economic_Resource_state = Economic_Resource_state == Economic_Resource.available;
		require(_Economic_Resource_state, "Economic Resource not satisfied, cannot run sold");

		Economic_Resource_state = Economic_Resource.unavailable;
	}

	function request_catalogue() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.None;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run request_catalogue");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.None;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run request_catalogue");

		Business_Process_Overview_state = Business_Process_Overview.planning;
		Business_Process_Detail_state = Business_Process_Detail.catalogue_requested;
	}

	function non_committal_order() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.planning;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run non_committal_order");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.catalogue_received;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run non_committal_order");

		Business_Process_Overview_state = Business_Process_Overview.identification;
		Business_Process_Detail_state = Business_Process_Detail.identification;
	}

	function abandon() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.planning || Business_Process_Overview_state == Business_Process_Overview.identification || Business_Process_Overview_state == Business_Process_Overview.negotiation || Business_Process_Overview_state == Business_Process_Overview.actualization;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run abandon");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.catalogue_requested || Business_Process_Detail_state == Business_Process_Detail.catalogue_received || Business_Process_Detail_state == Business_Process_Detail.identification || Business_Process_Detail_state == Business_Process_Detail.negotiation || Business_Process_Detail_state == Business_Process_Detail.counter_consideration || Business_Process_Detail_state == Business_Process_Detail.remittance || Business_Process_Detail_state == Business_Process_Detail.despatch || Business_Process_Detail_state == Business_Process_Detail.receipt || Business_Process_Detail_state == Business_Process_Detail.invoice;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run abandon");

		Business_Process_Overview_state = Business_Process_Overview.post_actualization;
		Business_Process_Detail_state = Business_Process_Detail.abandoned;
	}

	function order() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.identification || Business_Process_Overview_state == Business_Process_Overview.negotiation;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run order");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.negotiation || Business_Process_Detail_state == Business_Process_Detail.counter_consideration;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run order");

		Business_Process_Overview_state = Business_Process_Overview.negotiation;
		Business_Process_Detail_state = Business_Process_Detail.offer_consideration;
	}

	function response_simple_accept() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.negotiation;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run response_simple_accept");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.offer_consideration;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run response_simple_accept");

		Business_Process_Overview_state = Business_Process_Overview.actualization;
		Business_Process_Detail_state = Business_Process_Detail.remittance;
	}

	function response_simple_reject() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.negotiation;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run response_simple_reject");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.offer_consideration;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run response_simple_reject");

		Business_Process_Overview_state = Business_Process_Overview.post_actualization;
		Business_Process_Detail_state = Business_Process_Detail.abandoned;
	}

	function invoice() public {
		bool _Business_Process_Overview_state = Business_Process_Overview_state == Business_Process_Overview.actualization;
		require(_Business_Process_Overview_state, "Business Process Overview not satisfied, cannot run invoice");

		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.invoice;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run invoice");

		Business_Process_Overview_state = Business_Process_Overview.post_actualization;
		Business_Process_Detail_state = Business_Process_Detail.completed;
	}

	function catalogue() public {
		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.catalogue_requested;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run catalogue");

		Business_Process_Detail_state = Business_Process_Detail.catalogue_received;
	}

	function availability_report() public {
		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.identification;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run availability_report");

		Business_Process_Detail_state = Business_Process_Detail.negotiation;
	}

	function response_counter() public {
		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.offer_consideration;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run response_counter");

		Business_Process_Detail_state = Business_Process_Detail.counter_consideration;
	}

	function remittance_advice() public {
		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.remittance;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run remittance_advice");

		Business_Process_Detail_state = Business_Process_Detail.despatch;
	}

	function despatch_advice() public {
		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.despatch;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run despatch_advice");

		Business_Process_Detail_state = Business_Process_Detail.receipt;
	}

	function receipt_advice() public {
		bool _Business_Process_Detail_state = Business_Process_Detail_state == Business_Process_Detail.receipt;
		require(_Business_Process_Detail_state, "Business Process Detail not satisfied, cannot run receipt_advice");

		Business_Process_Detail_state = Business_Process_Detail.invoice;
	}

	function offer() public {
		bool _Economic_Contract_state = Economic_Contract_state == Economic_Contract.None;
		require(_Economic_Contract_state, "Economic Contract not satisfied, cannot run offer");

		Economic_Contract_state = Economic_Contract.offered;
	}

	function accept() public {
		bool _Economic_Contract_state = Economic_Contract_state == Economic_Contract.offered;
		require(_Economic_Contract_state, "Economic Contract not satisfied, cannot run accept");

		Economic_Contract_state = Economic_Contract.accepted;
	}

	function service() public {
		bool _Economic_Contract_state = Economic_Contract_state == Economic_Contract.accepted;
		require(_Economic_Contract_state, "Economic Contract not satisfied, cannot run service");

		bool _Economic_Commitment_state = Economic_Commitment_state == Economic_Commitment.proposed;
		require(_Economic_Commitment_state, "Economic Commitment not satisfied, cannot run service");

		bool _Economic_Event_state = Economic_Event_state == Economic_Event.specified;
		require(_Economic_Event_state, "Economic Event not satisfied, cannot run service");

		Economic_Contract_state = Economic_Contract.in_service;
		Economic_Commitment_state = Economic_Commitment.in_service_commitment;
		Economic_Event_state = Economic_Event.in_service_event;
	}

	function complete_contract() public {
		bool _Economic_Contract_state = Economic_Contract_state == Economic_Contract.in_service;
		require(_Economic_Contract_state, "Economic Contract not satisfied, cannot run complete_contract");

		Economic_Contract_state = Economic_Contract.contract_complete;
	}

	function propose() public {
		bool _Economic_Commitment_state = Economic_Commitment_state == Economic_Commitment.None;
		require(_Economic_Commitment_state, "Economic Commitment not satisfied, cannot run propose");

		Economic_Commitment_state = Economic_Commitment.proposed;
	}

	function complete_commitment() public {
		bool _Economic_Commitment_state = Economic_Commitment_state == Economic_Commitment.in_service_commitment;
		require(_Economic_Commitment_state, "Economic Commitment not satisfied, cannot run complete_commitment");

		Economic_Commitment_state = Economic_Commitment.commitment_complete;
	}

	function specify() public {
		bool _Economic_Event_state = Economic_Event_state == Economic_Event.None;
		require(_Economic_Event_state, "Economic Event not satisfied, cannot run specify");

		Economic_Event_state = Economic_Event.specified;
	}

	function pending_contract() public {
		bool _Economic_Event_state = Economic_Event_state == Economic_Event.in_service_event;
		require(_Economic_Event_state, "Economic Event not satisfied, cannot run pending_contract");

		Economic_Event_state = Economic_Event.pending_event;
	}

	function complete_event() public {
		bool _Economic_Event_state = Economic_Event_state == Economic_Event.pending_event;
		require(_Economic_Event_state, "Economic Event not satisfied, cannot run complete_event");

		Economic_Event_state = Economic_Event.event_complete;
	}

	function phase_start() public {
		bool _Business_Process_Phase_state = Business_Process_Phase_state == Business_Process_Phase.None;
		require(_Business_Process_Phase_state, "Business Process Phase not satisfied, cannot run phase_start");

		Business_Process_Phase_state = Business_Process_Phase.phase_waiting;
	}

	function phase_service() public {
		bool _Business_Process_Phase_state = Business_Process_Phase_state == Business_Process_Phase.phase_waiting;
		require(_Business_Process_Phase_state, "Business Process Phase not satisfied, cannot run phase_service");

		Business_Process_Phase_state = Business_Process_Phase.in_service_phase;
	}

	function complete_phase() public {
		bool _Business_Process_Phase_state = Business_Process_Phase_state == Business_Process_Phase.in_service_phase;
		require(_Business_Process_Phase_state, "Business Process Phase not satisfied, cannot run complete_phase");

		Business_Process_Phase_state = Business_Process_Phase.phase_complete;
	}

}
